import React from 'react';
import './App.css';
import Navbar from './component/navbar';
import Dashboard from './pages/Dashboard';
import Telegram from './pages/Telegram';
import Twitter from './pages/Twitter';
import UPI from './pages/UPI';
import Youtube from './pages/Youtube';
import Login from './login';  
import Register from './register';
import {BrowserRouter as Router,Routes,Route} from 'react-router-dom';
function App() {
  // const location = useLocation();
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <div >
          <Route path="/dashboard" element={<div><Navbar/><Dashboard /></div>} />
          <Route path="/telegram" element={<div><Navbar/><Telegram /></div>} />
          <Route path="/twitter" element={<div><Navbar/><Twitter /></div>} />
          <Route path="/upi" element={<div><Navbar/><UPI /></div>} />
          <Route path="/youtube" element={<div><Navbar/><Youtube /></div>} />
          </div>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
